    false,nt"url": null,nt"notes": "This data set contains sensitive biological
    resource data for anadromous fish species in Northwest Arctic, Alaska. Vector arcs
    in this data set represent species occurrences in streams. Species-specific abundance,
    seasonality, status, life history, and source information are stored in relational
    data tables (described below) designed to be used in conjunction with this spatial
    data layer. See also the FISH (Fish Polygons) data layer, part of the larger Northwest
    Arctic database, for additional anadromous fish information.This data set comprises
    a portion of the Environmental Sensitivity Index (ESI) data for Northwest Arctic,
    Alaska. ESI data characterize the marine and coastal environments and wildlife by
    their sensitivity to spilled oil. The ESI data include information for three main
    components: shoreline habitats, sensitive biological resources, and human-use resources.",nt"license_title":
